import React, { useState } from 'react';
import Layout from './components/Layout';
import LeftSidebar from './components/LeftSidebar';
import RightSidebar from './components/RightSidebar';
import Home from './pages/Home';

function App() {
  const [selectedModel, setSelectedModel] = useState(null);

  return (
    <Layout
      header={<h1>Conceptual Models Explorer</h1>}
      sidebarLeft={<LeftSidebar />}
      main={<Home selectedModel={selectedModel} onSelectModel={setSelectedModel} />}
      sidebarRight={<RightSidebar models={[]} onSelectModel={setSelectedModel} />}
      footer={
        <p>
          All information belongs to the respective authors. Portions of this content were generated
          using AI and may contain inaccuracies. Verify against original sources.
        </p>
      }
    />
  );
}

export default App;
